import React from 'react';

const Gastos = (props) => {

  const cuentaId = (`${props.selectedCuentaId}`)
  console.log(cuentaId)


  return (
    <div className="gastos">
      <h2>Gastos</h2>
      <ul>
        <li>Ocio: 10€</li>
        <li>Ropa: 10€</li>
        <li>Café: 10€</li>
      </ul>
    </div>
  );
};

export default Gastos;
